John Wozniak's first effort, Zog BogBean - From the Marcy Playground, was self-produced and recorded in his bedroom studio with some help from his then-girlfriend Sherry Fraser and her brother, Scott. A small run of CDs were self-released by Wozniak, and they remain extremely difficult to find to this day. &quot;Our Generation&quot; and &quot;Dog And His Master&quot; would appear on later Marcy Playground albums. -wikipedia


